const getNotificationEvent = async (program, key, stage) => {
  try {
    console.log({ program, key, stage });

    const response = await LocalForageServiceInstance.getItem(
      "dataStore", "dataStore"
    );

    if (stage) {
      const data = response?.notificationEvents?.events?.find(
        (resp) =>
          resp?.programId === program &&
          resp?.event?.includes(key) &&
          resp?.stage === stage
      );
      console.log({ data });
      return data;
    } else {
      // First try exact match for specific events
      let data = response?.notificationEvents?.events?.find(
        (resp) => resp?.programId === program && resp?.event === key
      );
      
      // If no exact match, fall back to partial match for backward compatibility
      if (!data) {
        data = response?.notificationEvents?.events?.find(
          (resp) => resp?.programId === program && resp?.event?.includes(key)
        );
      }
      
      return data;
    }
  } catch (error) {
    console.log({ error });
    return null;
  }
};

const sendNotificationHandler = async (subject, message, userIds) => {
  try {
    // ðŸ”¹ Send message if we have users
    if (userIds.length > 0) {
      const users = userIds?.map((u) => ({ id: u })) || [];
      await dataStore.post("/messageConversations", {
        subject: subject,
        text: message,
        users: users,
        messageType: "PRIVATE",
      });

      showToast("Notification is sent.", "success");
    } else {
      showToast("No reciepients found", "warning");
    }
  } catch (err) {
    showToast("Failed to send notification", "error");
  }
};

