// helper to upload file
async function uploadFile(filePath) {
  const form = new FormData();
  form.append("file", filePath); // `file` is a File object (from input[type=file])
  const res = await dataStore.post("fileResources", form);
  return res?.data?.response?.fileResource?.id;
}

async function buildDataItems(formData, filedataItems, key) {
  const dataItems = [];

  for (const dataItemId of Object.keys(formData)) {
    const value = formData[dataItemId];
    if (
      filedataItems &&
      filedataItems?.includes(dataItemId) &&
      value instanceof File
    ) {
      const fileUid = await uploadFile(value);
      dataItems.push({ [key]: dataItemId, value: fileUid });
    } else {
      dataItems.push({ [key]: dataItemId, value });
    }
  }
  return dataItems;
}

