async function registerTEI(
  formData,
  fileDataIDs,
  program,
  selectedOrganisationUnit,
  isEdit = false,
  existingEntityId = null
) {
  try {
    const attributes = await buildDataItems(formData, fileDataIDs, "attribute");
    const date = new Date().toISOString();

    let payload;
    let importStrategy = "CREATE";

    if (isEdit && existingEntityId) {
      // Update existing tracked entity
      const gg = [];
      attributes.map((k) => {
        if (Array.isArray(k.value)) {
          gg.push({
            attribute: k.attribute,
            value: k.value.join(","),
          });
        } else {
          gg.push(k);
        }
      });
      payload = {
        trackedEntity: existingEntityId,
        trackedEntityType: program?.trackedEntityType?.id,
        orgUnit: selectedOrganisationUnit,
        attributes: gg,
      };
      importStrategy = "UPDATE";
    } else {
      // Create new tracked entity
      payload = {
        trackedEntityType: program?.trackedEntityType?.id,
        orgUnit: selectedOrganisationUnit,
        attributes,
        enrollments: [
          {
            attributes,
            enrolledAt: date,
            occurredAt: date,
            orgUnit: selectedOrganisationUnit,
            program: program?.id,
            trackedEntityType: program?.trackedEntityType?.id,
            status: "ACTIVE",
          },
        ],
      };
    }

    const response = await dataStore.mutate(
      `tracker?async=false&importStrategy=${importStrategy}`,
      "POST",
      { trackedEntities: [payload] }
    );
    if (importStrategy === "CREATE") {
      const teiId =
        response?.bundleReport?.typeReportMap?.TRACKED_ENTITY
          ?.objectReports?.[0]?.uid;
      const configData = await getNotificationEvent(
        program?.id,
        importStrategy
      );

      await notificationSendTrigger(configData?.event, {
        orgUnit: selectedOrganisationUnit,
        program: program?.id,
        count: 1,
        teiId,
      });
    }
    return response;
  } catch (error) {
    return error;
  }
}

async function registerMultipleTEI(
  formData,
  fileDataIDs,
  program,
  selectedOrganisationUnit,
  commonData
) {
  try {
    const date = new Date().toISOString();
    const importStrategy = "CREATE";

    const formEntries = Array.isArray(formData) ? formData : [formData];
    const uploadedFilesCache = new Map(); // track uploaded files for common attributes
    const allPayloads = [];

    const commonAttributes = Object.keys(commonData); // attributes to deduplicate

    for (const entry of formEntries) {
      const mergedData = { ...commonData, ...entry };

      // Build attributes for this entry only
      const attributes = [];

      for (const dataItemId of Object.keys(mergedData)) {
        const value = mergedData[dataItemId];

        if (fileDataIDs?.includes(dataItemId) && value instanceof File) {
          let fileUid;

          // Deduplicate if this attribute is common
          if (
            commonAttributes.includes(dataItemId) &&
            uploadedFilesCache.has(dataItemId)
          ) {
            fileUid = uploadedFilesCache.get(dataItemId);
          } else {
            fileUid = await uploadFile(value);
            if (commonAttributes.includes(dataItemId)) {
              uploadedFilesCache.set(dataItemId, fileUid);
            }
          }

          attributes.push({ attribute: dataItemId, value: fileUid });
        } else if (Array.isArray(value)) {
          for (const v of value) {
            attributes.push({ attribute: dataItemId, value: v });
          }
        } else {
          attributes.push({ attribute: dataItemId, value });
        }
      }

      const payload = {
        trackedEntityType: program?.trackedEntityType?.id,
        orgUnit: selectedOrganisationUnit,
        attributes,
        enrollments: [
          {
            attributes,
            enrolledAt: date,
            occurredAt: date,
            orgUnit: selectedOrganisationUnit,
            program: program?.id,
            trackedEntityType: program?.trackedEntityType?.id,
            status: "ACTIVE",
          },
        ],
      };

      allPayloads.push(payload);
    }

    // Send all TEIs at once
    const response = await dataStore.mutate(
      `tracker?async=false&importStrategy=${importStrategy}`,
      "POST",
      { trackedEntities: allPayloads }
    );

    if (importStrategy === "CREATE") {
      const teiId =
        response?.bundleReport?.typeReportMap?.TRACKED_ENTITY?.objectReports?.map(
          (ids) => ids?.uid
        );

      await notificationSendTrigger("EQUIPMENT_REGISTRATION", {
        orgUnit: selectedOrganisationUnit,
        program: program?.id,
        count: allPayloads?.ength,
        teiId: teiId[0],
      });
    }
    return response;
  } catch (error) {
    console.error("Error registering multiple TEIs:", error);
  }
}

