// Function to calculate autofill values for deregistration
const calculateDeregistrationAutofill = (teiAttributes, isolationDate = null, currentUser = null) => {
    const autofillValues = [];

    DEREGISTRATION_CONFIG.AUTOFILL_MAPPING.forEach(mapping => {
        const sourceAttribute = teiAttributes?.find(attr => attr.attribute === mapping.sourceId);

        if (sourceAttribute) {
            let value = sourceAttribute.value;

            // Handle calculated lifespan
            if (mapping.type === "CALCULATED_LIFESPAN") {
                let yearOfManufacture;

                // Handle both year format (2024) and date format (2024-01-01)
                if (sourceAttribute.value.includes("-")) {
                    // Date format, extract year
                    yearOfManufacture = parseInt(sourceAttribute.value.split("-")[0]);
                } else {
                    // Year format
                    yearOfManufacture = parseInt(sourceAttribute.value);
                }

                const currentDate = isolationDate ? new Date(isolationDate) : new Date();
                const currentYear = currentDate.getFullYear();

                if (!isNaN(yearOfManufacture) && yearOfManufacture > 1900) {
                    value = (currentYear - yearOfManufacture).toString();
                } else {
                    value = ""; // Invalid year, leave empty
                }
            }

            autofillValues.push({
                id: mapping.targetId,
                value: value
            });
        }
    });

    // Note: De-registration approving officer is NOT autofilled here
    // It will be autofilled when the admin opens the approval section in deregistrationEvent.widget.jsx

    // Add current user's username as "Isolated By"
    // Note: The username must exist in the "Users" option set for it to display in the dropdown
    if (currentUser?.username) {
        autofillValues.push({
            id: DEREGISTRATION_CONFIG.ISOLATED_BY_FIELD_ID,
            value: currentUser.username,
            locked: true // Lock from editing - this should be the user who created the request
        });
    }

    // Add current date as "Date of Isolation"
    const currentDate = new Date().toISOString().split('T')[0]; // Format: YYYY-MM-DD
    autofillValues.push({
        id: DEREGISTRATION_CONFIG.DATE_OF_ISOLATION_FIELD_ID,
        value: currentDate,
        locked: false // Allow editing if needed
    });

    return autofillValues;
};

