const getAvailableEquipmentCount = async (event) => {

    try {
        if (!event) return null;

        // Load full datastore config
        const config = await LocalForageServiceInstance.getItem("dataStore", "dataStore");
        const calculations = config?.calculations;

        // Find the specific program config
        const prog = calculations?.configurations?.find(
            (c) => c?.programId === event?.program
        );
        const filter = event?.dataValues.find(de => de?.dataElement === prog?.source?.value);
        if (!prog) {
            console.warn("No config found for program:", event?.program);
            return null;
        }

        // ---- Build query params dynamically ----
        const params = { ...prog.query.params };

        // Replace {{equip_code}} inside filter if present
        Object.keys(params).forEach((key) => {
            if (typeof params[key] === "string") {
                params[key] = params[key].replace("{{equip_code}}", filter?.value);
            }
        });

        // Convert params object to URL query string

        const queryString = Object.entries(params)
            .map(([key, val]) => `${key}=${val}`)
            .join("&");

        // Full endpoint
        const url = `${prog.query.endpoint}?${queryString}`;

        // ---- Fetch data ----
        const data = await dataStore.get(url);
        const trackedEntities = data?.data?.trackedEntities;
        if (trackedEntities?.length === 0) {
            return {
                equip_code: filter?.value,
                value: 0 // TODO: compute from data
            };
        }

        const events = await dataStore.get(`tracker/events?program=${prog?.query?.params?.program}&programStage=${prog?.stage}&filterAttributes=${prog?.attribute}:eq:${filter?.value}`);
        const entityIds = trackedEntities?.map(tei => tei?.trackedEntity);
        const notExitingTei = entityIds?.filter(teiEvent => !events?.data?.events?.some(ev => ev?.trackedEntity === teiEvent));
        const available = trackedEntities?.filter(te => notExitingTei?.some(t => t === te?.trackedEntity));
        return {
            equip_code: filter?.value,
            value: notExitingTei?.length, // TODO: compute from data
            equipment: available
        };

    } catch (error) {
        console.log(error);
        return error
    }
};

